import React from "react"
import { Link } from "react-router-dom"

class Home extends React.Component{
    render (){
        return(
            <div className="h-screen">
                <div className="nav">
                    <Link>Sign in.</Link>
                </div>
                <div className="text-5xl bg-gray-400 w-screen h-96 flex">
                    <span className="mx-auto mt-56">Hello</span>
                </div>
                <div className="bg-gray-400 w-screen h-32 flex">
                    <input type="email" placeholder="Enter your email." className="h-12 bg-transparent mx-auto"></input>
                </div>
            </div>
        )
    }
}

export default Home
